import "./SidebarStyle.css"
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import StudentList from "./StudentList";
import InfoBox from "./InfoBox";
import React from "react";


const SideBar=(props)=>
{
    return(
        <Router>
            <ul className = "side">
                <li className = "side"><Link  to= "/profile" className = "side" >Profile Info</Link></li>
                <li className = "side"><Link  to= "/favouriteList" className = "side" >Courses</Link></li>
                <li className = "side"><Link to= "/blackList" className = "side" >Appointments</Link></li>
            </ul>

            <Switch>
                <Route path = "/profile-info">
                    <InfoBox name = {props.name} surname = {props.surname} id = {props.id} hesCode = {props.hesCode} />
                </Route>
                <Route path = "/courses">
                   <StudentList/>
                </Route>

                <Route path = "/appointments">

                </Route>
            </Switch>
        </Router>
    );
}

export default SideBar;
